# Smallest Range
from typing import List
import queue
import time
class Solution:
    def smallestRange(self, nums: List[List[int]]) -> List[int]:
        N = len(nums)
        q = queue.PriorityQueue()
        for i in range(len(nums)):
            q.put((nums[i][0], i))
            prev = nums[i][0]
            for j in nums[i]:
                if j == prev:
                    continue
                q.put((j, i))
                prev = j
        vals = [None] * N
        minRange = float('inf')
        Range = []
        t1 = time.time()
        i = 0
        loweridx = None
        lower_o = None
        while not q.empty():
            i += 1
            a, b = q.get()
            vals[b] = a
            try:
                if loweridx == b or not lower_o:
                    upper, lower = a, min(vals)
                    loweridx = vals.index(lower)
                    lower_o = lower
                else:
                    upper, lower = a, lower_o
                diff = upper - lower
                if diff < minRange:
                    Range = [lower, upper]
                    minRange = diff
            except Exception:
                continue
        print(i)
        t10 = time.time()
        print(t10 - t1)
        return Range



